const searchReducer = (state = initialState, action) => {
    switch (action.type) {
        case SHOW_MORE: {
            let stateCopy = {...state};//делаем поверностную копию обьекта
            stateCopy.newPostText = {...state.newPostText}//делаем глубокую копию обьекта
            stateCopy.newPostText = action.text;/*меняем текс при изменении в поле инпут*/
            return stateCopy;
        }//возвращаем копию
        case FOLLOW_FRIENDS: {
            let stateCopy = {...state, initialState: [...state.initialState]};//делаем поверностную копию обьекта
            return stateCopy;
        }//возвращаем копию
        default: {
            return state
        }
    }
}
/*создание экшенов для диспатча*/
export const followFriendsActionCreator = (text) => ({type: FOLLOW_FRIENDS});/*from addTextPost in Profile*/
export const unfollowFriendsActionCreator = (text) => ({type: UNFOLLOW_FRIENDS});/*from addTextPost in Profile*/
/*если функция только возвращает значение ее можно записать так*/
